import React from "react";
import { Link } from "react-router-dom";
import "../assets/home-dark.css";

import poionakoTeam from "../assets/img/poionakoteam.png";
import lukasitoTeam from "../assets/img/lukasitoteam.png";
import tchubiTeam from "../assets/img/tchubiteam.png";
import dilanzitoTeam from "../assets/img/dilanzitoteam.png";
import deathwinguaTeam from "../assets/img/deathwinguateam.png";
import salomon96Team from "../assets/img/salomon96team.png";
import juninTeam from "../assets/img/juninnewlogo.png";
import alexdieciTeam from "../assets/img/alexdieci.webp";
import captainmykoTeam from "../assets/img/captainmyko.png";
import lootroomTextLogo from "../assets/img/lootroomlogo.png";
import rustypotTextLogo from "../assets/img/rustypotlogo.png";
import syvarLogo from "../assets/img/syvarlogo.png";

const keyOutColorFromImage = (src, keyColor, tolerance = 110) =>
  new Promise((resolve, reject) => {
    const image = new Image();
    image.crossOrigin = "anonymous";
    image.onload = () => {
      const canvas = document.createElement("canvas");
      canvas.width = image.width;
      canvas.height = image.height;
      const ctx = canvas.getContext("2d");
      if (!ctx) {
        reject(new Error("Canvas context not available"));
        return;
      }
      ctx.drawImage(image, 0, 0);
      const imageData = ctx.getImageData(0, 0, canvas.width, canvas.height);
      const data = imageData.data;

      for (let i = 0; i < data.length; i += 4) {
        const dr = data[i] - keyColor.r;
        const dg = data[i + 1] - keyColor.g;
        const db = data[i + 2] - keyColor.b;
        const distance = Math.sqrt(dr * dr + dg * dg + db * db);
        if (distance <= tolerance) {
          data[i + 3] = 0;
        }
      }

      ctx.putImageData(imageData, 0, 0);
      resolve(canvas.toDataURL());
    };
    image.onerror = reject;
    image.src = src;
  });

export default function Equipos() {
  React.useEffect(() => {
    document.body.classList.add("has-video-bg");
    return () => document.body.classList.remove("has-video-bg");
  }, []);

  const teams = React.useMemo(
    () => [
      { name: "PoiOnako Team", image: poionakoTeam },
      { name: "Lukasito Team", image: lukasitoTeam },
      { name: "TChubi Team", image: tchubiTeam },
      { name: "Dilanzito Team", image: dilanzitoTeam },
      { name: "Deathwingua Team", image: deathwinguaTeam },
      { name: "SalomonL96 Team", image: salomon96Team },
      { name: "Alexdieci Team", image: alexdieciTeam },
      { name: "CaptainMyko Team", image: captainmykoTeam },
      {
        name: "Junin Team",
        image: juninTeam,
        keyColor: { r: 20, g: 110, b: 40 },
        tolerance: 125,
      },
      { name: "To be confirmed", image: null },
    ],
    []
  );

  const [logoOverrides, setLogoOverrides] = React.useState({});

  React.useEffect(() => {
    let cancelled = false;
    const targets = teams.filter((team) => team.keyColor);
    if (!targets.length) {
      return () => {
        cancelled = true;
      };
    }

    Promise.all(
      targets.map((team) =>
        keyOutColorFromImage(team.image, team.keyColor, team.tolerance)
          .then((processed) => [team.name, processed])
          .catch(() => null)
      )
    ).then((results) => {
      if (cancelled) {
        return;
      }
      const next = {};
      results.forEach((entry) => {
        if (entry) {
          const [name, src] = entry;
          next[name] = src;
        }
      });
      setLogoOverrides(next);
    });

    return () => {
      cancelled = true;
    };
  }, [teams]);

  const [selectedTeam, setSelectedTeam] = React.useState(null);

  return (
    <div className="home-dark has-video-bg page-with-topbar">
      <header className="TopBar">
        <nav className="TopBar-links" aria-label="Navigation">
          <Link to="/" className="nav-btn">Home</Link>
          <Link to="/reglas" className="nav-btn">Rules</Link>
          <Link to="/equipos" className="nav-btn">Teams</Link>
        </nav>
      </header>

      <main className="teams-page">
        <h1 className="reglas-title">Teams</h1>

        <div className="teams-grid">
          {teams.map((team, idx) => (
            <button
              key={`${team.name}-${idx}`}
              className="team-card"
              type="button"
              onClick={() => setSelectedTeam(team)}
            >
              {team.image ? (
                <img
                  className="team-logo"
                  src={logoOverrides[team.name] || team.image}
                  alt={team.name}
                />
              ) : (
                <div className="team-logo team-logo--placeholder" aria-hidden />
              )}
              <div className="team-name">{team.name}</div>
            </button>
          ))}
        </div>
      </main>

      {selectedTeam && (
        <div className="team-modal-overlay" onClick={() => setSelectedTeam(null)} role="presentation">
          <div className="team-modal" role="dialog" aria-modal="true" onClick={(e) => e.stopPropagation()}>
            <div className="team-modal-header">
              <span>{selectedTeam.name}</span>
              <button className="team-modal-close" onClick={() => setSelectedTeam(null)} aria-label="Close">
                ✕
              </button>
            </div>
            <div className="team-modal-body">Soon..</div>
          </div>
        </div>
      )}

      <footer
        style={{
          position: "relative",
          zIndex: 20,
          padding: "0.9rem 1.5rem 1.6rem",
          color: "#b3cfff",
          fontSize: "0.95rem",
          marginTop: "auto",
          background:
            "linear-gradient(90deg, rgba(8,8,10,0.78), rgba(226,88,34,0.18), rgba(114,137,218,0.12))",
          borderTop: "1px solid rgba(255,255,255,0.18)",
          boxShadow: "0 -10px 34px rgba(0,0,0,0.6)",
          backdropFilter: "blur(12px)",
          WebkitBackdropFilter: "blur(12px)",
          display: "flex",
          alignItems: "center",
          justifyContent: "space-between",
          flexWrap: "wrap",
          rowGap: "0.6rem",
        }}
      >
        <div
          style={{
            display: "flex",
            alignItems: "center",
            gap: 14,
            flexWrap: "wrap",
          }}
        >
          <div style={{ fontWeight: 600 }}>© Derechos reservados Rustaco Events</div>

          <a
            href="https://discord.rustaco.site"
            target="_blank"
            rel="noopener noreferrer"
            style={{
              display: "inline-flex",
              alignItems: "center",
              gap: 8,
              padding: "0.45rem 1.3rem",
              borderRadius: 999,
              background:
                "linear-gradient(90deg, #5865f2 0%, #3a4bd8 60%, #23201a 100%)",
              color: "#fff",
              fontWeight: 700,
              fontSize: "0.95rem",
              textDecoration: "none",
              boxShadow: "0 6px 20px rgba(0,0,0,0.7)",
            }}
          >
            Discord
          </a>
        </div>

        <div
          style={{
            marginLeft: "auto",
            display: "flex",
            alignItems: "center",
            gap: 16,
          }}
        >
          <a
            href="https://lootroom.com/"
            target="_blank"
            rel="noopener noreferrer"
            style={{
              display: "inline-flex",
              alignItems: "center",
              justifyContent: "center",
              textDecoration: "none",
            }}
          >
            <img
              src={lootroomTextLogo}
              alt="Lootroom"
              style={{
                width: 160,
                height: "auto",
                objectFit: "contain",
                display: "block",
              }}
            />
          </a>

          <a
            href="https://rustypot.com/"
            target="_blank"
            rel="noopener noreferrer"
            style={{
              display: "inline-flex",
              alignItems: "center",
              justifyContent: "center",
              textDecoration: "none",
            }}
          >
            <img
              src={rustypotTextLogo}
              alt="Rustypot"
              style={{
                width: 130,
                height: "auto",
                objectFit: "contain",
                display: "block",
              }}
            />
          </a>

          <img
            src={syvarLogo}
            alt="Syvar"
            style={{
              width: 140,
              height: "auto",
              objectFit: "contain",
              display: "block",
            }}
          />
        </div>
      </footer>
    </div>
  );
}
